import React from 'react';

const Photolist = (props) => {

    return(
        // <div>
        //     {(props.photoArray || []).map((photoArray,i) => (
        //         <div key={i}>                
        //         <img src={photoArray.urls.raw} alt={photoArray.alt_description} />
        //         </div>
        //     ))}
        // </div>
        <div>
           {(Object.keys(props.photoArray) || []).map((photoArray,i) => (
                <div key={i}>                
                 <img src={photoArray.urls.raw} alt={photoArray.alt_description} />
                 </div>
             ))}

        </div>

    ) 
}

